import { Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import ProductPage from './components/ProductPage';
import Footer from './components/Footer'
function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Routes>
          <Route path="/" element={<ProductPage/>}/>
        </Routes>
        <Footer/>
      </Router>
    </div>
  );
}

export default App;
